d1a8f68c92e1973f0c27522/images/678394cc-aa05-6d03-0c1c-dd52448500be.png" class="mceLogo"/></span></td></tr><tr><td style="padding-top:0;padding-bottom:0;padding-right:0;padding-left:0" valign="top"><table width="100%" style="border:0;border-collapse:separate"><tbody><tr><td style="padding-left:24px;padding-right:24px;padding-top:12px;padding-bottom:12px" class="mceTextBlockContainer"><div data-block-id="3" class="mceText" id="dataBlockId-3" style="width:100%"><h1 class="last-child">Known for Quality and Safety</h1></div></td></tr></tbody></table></td></tr><tr><td style="padding-top:0;padding-bottom:0;padding-right:0;padding-left:0" class="mceBlockContainer" align="center" valign="top"><span class="mceImageBorder" style="border:0;vertical-align:top;margin:0"><img data-block-id="4" width="564" height="auto" style="width:564px;height:auto;max-width:812px !important;display:block" alt="" src="https://mcusercontent.com/f9d1a8f68c92e1973f0c27522/images/2022a598-e235-6335-4b87-63d6c2e4d421.jpg" role="presentation" class="imageDropZone mceImage"/></span></td></tr><tr><td style="padding-top:0;padding-bottom:0;padding-right:0;padding-left:0" valign="top"><table width="100%" style="border:0;border-collapse:separate"><tbody><tr><td style="padding-left:24px;padding-right:24px;padding-top:12px;padding-bottom:12px" class="mceTextBlockContainer"><div data-block-id="15" class="mceText" id="dataBlockId-15" style="width:100%"><p style="text-align: left;"><br/></p><p style="text-align: left;"><br/></p><p style="text-align: left;"><strong>Prepared for:<br/>Mr. Nitin</strong></p><p style="text-align: left;"><strong>Created by:<br/>Mr. Paresh Patil</strong></p><p><br/></p><p style="text-align: left;"><br/></p><p style="text-align: left;"><br/></p><h2 style="text-align: left;">About Us</h2><p style="text-align: left;">Provide all Types of Transport Vehicles to Companies<br/>Established on March 2012<br/>Website: <a href="http://www.siddhivinayaktravelshouse.in/">www.siddhivinayaktravelshouse.in</a></p><p style="text-align: left;"><br/>Passenger’s satisfaction it’s the prime motto of our business, which has helped us to build a good network.<br/>The Company today holds more than 1, 00,000 satisfied Passengers and is still framing the travel diaries of fresh clients.</p><h2 style="text-align: left;">Our Clients</h2><p style="text-align: left;"><br/></p><p><br/></p><h2 style="text-align: left;">Facilities Proposed</h2><ul><li><p style="text-align: left;">Vehicle will be well maintain and clean interior.</p></li><li><p style="text-align: left;">We assured that drivers follow all RTO rules and behavior will be good with passengers.</p></li><li><p style="text-align: left;">Proper vehicle documents as per rules.</p></li><li><p style="text-align: left;">Every vehicle has monthly 4 maintenance off replace vehicle will be provided.</p></li><li><p style="text-align: left;">All vehicles have first party insurance which cover vehicle, Driver as well as passengers.</p></li><li><p style="text-align: left;">Extra backup Cab will be provided if any emergency vehicle breakdown.</p></li></ul><p><br/></p><h2 style="text-align: left;">Drivers provided</h2><ul><li><p style="text-align: left;">Police Verification completed with all documents</p></li><li><p style="text-align: left;">All drivers will have single shift only for safety reason</p></li><li><p style="text-align: left;">Experienced drivers with weekly training provided by us</p></li><li><p style="text-align: left;">Good behaviors with passengers and non-addictive</p><p><br/></p></li></ul><h2 style="text-align: left;">Safety provided</h2><ul><li><p style="text-align: left;">Fire extension available in all vehicle</p></li><li><p style="text-align: left;">First Aid box available in all vehicles.</p></li><li><p style="text-align: left;">There is an emergency number inside the vehicle</p></li></ul><p><br/></p><h2 style="text-align: left;">Terms &amp; Condition!</h2><ul><li><p style="text-align: left;">This quotation is excluded of parking, and any Govt tax, will be charge at actual.</p></li><li><p style="text-align: left;">Toll charges would be reimbursed.</p></li><li><p style="text-align: left;">Monthly Payment Cheque or NEFT should be in favor of SIDDHIVINAYAK TRAVELS HOUSE within the 15 days of submission of monthly bill.</p></li></ul><p style="text-align: left;"><br/>For any type of query on given quotation, Please be free to contact us.<br/>Hope you will be satisfy with our quotation provided and looking forward positive reply from you.</p><p style="text-align: left;"> </p><p style="text-align: left;"> </p><h2 style="text-align: center;">Thank You!</h2><p style="text-align: left;" class="last-child"><br/></p></div></td></tr></tbody></table></td></tr><tr><td style="background-color:transparent;padding-top:20px;padding-bottom:20px;padding-right:24px;padding-left:24px" class="mceBlockContainer" valign="top"><table align="center" border="0" cellpadding="0" cellspacing="0" width="100%" style="background-color:transparent;width:100%" role="presentation" class="mceDividerContainer" data-block-id="6"><tbody><tr><td style="min-width:100%;border-top-width:2px;border-top-style:solid;border-top-color:#000000" class="mceDividerBlock" valign="top"></td></tr></tbody></table></td></tr><tr><td style="padding-top:12px;padding-bottom:12px;padding-right:0;padding-left:0" class="mceLayoutContainer" valign="top"><table align="center" border="0" cellpadding="0" cellspacing="0" width="100%" role="presentation" data-block-id="7"><tbody><tr class="mceRow"><td style="background-position:center;background-repeat:no-repeat;background-size:cover" valign="top"><table border="0" cellpadding="0" cellspacing="24" width="100%" role="presentation"><tbody><tr><td style="margin-bottom:24px" class="mceColumn" data-block-id="-9" valign="top" colspan="12" width="100%"><table border="0" cellpadding="0" cellspacing="0" width="100%" role="presentation"><tbody><tr><td align="center" valign="top"><table border="0" cellp